import React from "react";
import "./App.css";
import Navigacija from "./dijeljeno/Navigacija";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Naslovna from "./dijeljeno/Naslovna";
import Prijava from "./dijeljeno/Prijava";
import Registracija from "./dijeljeno/Registracija";
import Profil from "./student/stranice/Profil";
import Provjere from "./student/stranice/Provjere";
import KreirajMaterijal from "./predavac/stranice/KreirajMaterijal";
import KreirajProvjeru from "./predavac/stranice/KreirajProvjeru";
import Ispravljanje from "./predavac/stranice/Ispravljanje";
import DodajPredmet from "./admin/stranice/DodajPredmet";
import Predmeti from "./admin/stranice/Predmeti";
import Podnozje from "./dijeljeno/Podnozje";

const App = () => {
  return (
    <Router>
      <Navigacija />
      {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
      <div id="sadrzaj">
        <Switch>
          <Route path="/" exact>
            <Naslovna />
          </Route>
          <Route path="/prijava">
            <Prijava />
          </Route>
          <Route path="/registracija">
            <Registracija />
          </Route>
          <Route path="/profil">
            <Profil />
          </Route>
          <Route path="/provjere">
            <Provjere />
          </Route>
          <Route path="/kreiraj_materijal">
            <KreirajMaterijal />
          </Route>
          <Route path="/kreiraj_provjeru">
            <KreirajProvjeru />
          </Route>
          <Route path="/ispravljanje">
            <Ispravljanje />
          </Route>
          <Route path="/dodaj_predmet">
            <DodajPredmet />
          </Route>
          <Route path="/Predmeti">
            <Predmeti />
          </Route>
        </Switch>
      </div>
      <Podnozje />
    </Router>
  );
};

export default App;
